import React from 'react';
import { View , StyleSheet} from 'react-native';

function OrderScreen(props) {
    return (
        <View style={styles.background}></View>
    );
}

const styles = StyleSheet.create({
    background:{
        flex: 1,
        backgroundColor: "pink"
    }
})

export default OrderScreen;
